import React from 'react';

import { Switch, Route ,BrowserRouter} from 'react-router-dom';

import Authority from '';
import UsedAuthority from './usedAuthority.component';


function authority(){
    return (
        <BrowserRouter>
          <div className="App">
            <Navbar />
            
            <Switch>
              <Route path="/authority" component={Authority} />
              <Route path="/usedauth" component={UsedAuthority} />
            </Switch>
          </div>
        </BrowserRouter>
      );
}
export default authority;
